import React, { useState } from "react";

export default function ProfilePage() {
  const preferenceOptions = ["Nature", "Culture", "Food", "History", "Adventure"];
  const [preferences, setPreferences] = useState([]);

  const togglePref = (option) => {
    setPreferences((prev) =>
      prev.includes(option)
        ? prev.filter((p) => p !== option)
        : [...prev, option]
    );
  };

  return (
    <div style={{ padding: 24 }}>
      <h1>Preferences (Test)</h1>
      {preferenceOptions.map((option) => (
        <label key={option} style={{ display: "block", margin: "6px 0" }}>
          <input
            type="checkbox"
            checked={preferences.includes(option)}
            onChange={() => togglePref(option)}
          />
          <span style={{ marginLeft: 8 }}>{option}</span>
        </label>
      ))}
      <pre style={{ marginTop: 16, background: "#eee", padding: 8 }}>
        {JSON.stringify(preferences, null, 2)}
      </pre>
    </div>
  );
}
